import React, { Component } from 'react';
import calculadora from '../imgs/calculadora.png'
import Intro_mpt from '../imgs/Intro_mpt.png'

class Logo_mpt extends Component{
    render(){
        return (
            <img src={Intro_mpt}/>

        );
    }
}

export default Logo_mpt;
